import React, { useState, useEffect } from 'react';
import Editor from '@monaco-editor/react';
import { RotateCcw, Play, Upload } from 'lucide-react';
import { useTheme } from '../../contexts/ThemeContext';
import { programmingLanguages, codeTemplates } from '../../data/mockData';

const CodeEditor = ({
  onRunCode,
  onSubmitCode,
  isRunning,
  isSubmitting,
  initialCode,
  language,
  setLanguage,
  submissionResult
}) => {
  const { isDark } = useTheme();
  const [code, setCode] = useState(initialCode);
  const [selectedLang, setSelectedLang] = useState(language);
  const [errors, setErrors] = useState([]);
  const [valid, setValid] = useState(false);

  useEffect(() => {
    setCode(codeTemplates[selectedLang] || '');
    setLanguage(selectedLang);
  }, [selectedLang]);

  useEffect(() => {
    const t = code.trim();
    const errs = [];
    if (!t) errs.push('Code cannot be empty');
    if (t.length < 10) errs.push('Too short');
    setErrors(errs);
    setValid(errs.length === 0);
  }, [code]);

  const run = () => onRunCode(code, selectedLang);
  const submit = () => onSubmitCode(code, selectedLang);

  return (
    <div className="bg-white dark:bg-gray-800 rounded-lg shadow-lg p-4 border">
      <div className="flex justify-between items-center mb-2">
        <div>
          <label className="mr-2 text-sm">Language:</label>
          <select
            className="border rounded p-1"
            value={selectedLang}
            onChange={e => setSelectedLang(e.target.value)}>
            {Object.entries(programmingLanguages).map(([key, name]) => (
              <option key={key} value={key}>{name}</option>
            ))}
          </select>
        </div>
        <button onClick={() => setCode(codeTemplates[selectedLang] || '')}>
          <RotateCcw />
        </button>
      </div>

      <Editor
        height="250px"
        language={selectedLang}
        theme={isDark ? 'vs-dark' : 'light'}
        value={code}
        onChange={v => setCode(v)}
      />

      {errors.length > 0 && (
        <ul className="mt-2 text-sm text-red-500">
          {errors.map((e,i) => <li key={i}>• {e}</li>)}
        </ul>
      )}

      <div className="flex justify-end gap-2 mt-4">
        <button
          onClick={run}
          disabled={!valid || isRunning}
          className="bg-green-600 text-white px-4 py-2 rounded disabled:bg-gray-400">
          <Play className="inline mr-1" /> {isRunning ? 'Running...' : 'Run'}
        </button>
        <button
          onClick={submit}
          disabled={!valid || isSubmitting}
          className="bg-blue-600 text-white px-4 py-2 rounded disabled:bg-gray-400">
          <Upload className="inline mr-1" /> {isSubmitting ? 'Submitting...' : 'Submit'}
        </button>
      </div>

      {submissionResult?.details && (
        <div className="mt-4 border-t pt-4">
          <h4>Test Case Results:</h4>
          {submissionResult.details.map((t, i) => (
            <div key={i} className={`p-2 rounded mb-2 ${t.passed ? 'bg-green-50 border-green-300' : 'bg-red-50 border-red-300'}`}>
              <strong>#{i+1} {t.passed ? '✅ Passed' : '❌ Failed'}</strong>
              {!t.passed && (
                <div className="text-xs text-gray-600 mt-1">
                  Input: <pre className="inline">{t.input}</pre><br/>
                  Expected: <pre className="inline">{t.expectedOutput}</pre><br/>
                  Got: <pre className="inline">{t.actualOutput}</pre>
                </div>
              )}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default CodeEditor;
